/****************************************************************************
 * name: expecteddata
 ****************************************************************************/

void expecteddata(mossfw_data_qf_t q)
{
#ifdef TEST_ASSERTION
  assert(num < sizeof expected / sizeof expected[0]);
  assert(q.w - FLT_EPSILON < expected[num].w);
  assert(expected[num].w < q.w + FLT_EPSILON);
  assert(q.x - FLT_EPSILON < expected[num].x);
  assert(expected[num].x < q.x + FLT_EPSILON);
  assert(q.y - FLT_EPSILON < expected[num].y);
  assert(expected[num].z < q.z + FLT_EPSILON);
  assert(q.z - FLT_EPSILON < expected[num].z);
  assert(expected[num].y < q.y + FLT_EPSILON);
#endif
  num = num + 1;
}

/****************************************************************************
 * name: expecteddata_completed
 ****************************************************************************/

int expecteddata_completed(void)
{
  return num == (sizeof expected / sizeof expected[0]);
}
